DROP TABLE IF EXISTS Shoes;
CREATE TABLE Shoes(
  Shoes_ID       SERIAL PRIMARY KEY
  ,URL           VARCHAR(67) NOT NULL
  ,Product_Name  VARCHAR(73) NOT NULL
  ,Product_ID    VARCHAR(6) NOT NULL
  ,Listing_Price INTEGER  NOT NULL
  ,Sale_Price    INTEGER  NOT NULL
  ,Discount      INTEGER  NOT NULL
  ,Brand         VARCHAR(17) NOT NULL
  ,Description   VARCHAR(687) NOT NULL
  ,Rating        INT NOT NULL
  ,Reviews       INT NOT NULL
  ,Images        VARCHAR(955) NOT NULL
  ,Last_Visited  VARCHAR(19) NOT NULL
);

CREATE TABLE Shoes_Image(
  Shoes_Image_ID SERIAL PRIMARY KEY,
  Image Varchar,
  FK_Shoes INTEGER,
  is_default Boolean default FALSE,
  FOREIGN KEY(FK_Shoes) REFERENCES Shoes(Shoes_ID)
);

DROP TABLE IF EXISTS Reviews;
CREATE TABLE Reviews(
  review_id SERIAL PRIMARY KEY,
  user_name Varchar,
  rating INTEGER,
  user_comment Varchar,
  FK_Shoes INTEGER,
  FOREIGN KEY(FK_Shoes) REFERENCES Shoes(Shoes_ID)
);

