Update shoes_image set is_default=true where shoes_image_id in(
  SELECT shoes_image_id FROM shoes_image
    WHERE shoes_image_id IN(
      SELECT MIN(shoes_image_id) FROM shoes_image GROUP BY fk_shoes
    )
)